tables.table_schema:
CREATE TABLE lighting_fixtures (
  fixture_id INT PRIMARY KEY,
  fixture_name VARCHAR(255),
  power_consumption INT,
  color_temperature INT
);

CREATE TABLE installation_instructions (
  instruction_id INT PRIMARY KEY,
  fixture_id INT,
  instruction_details TEXT,
  FOREIGN KEY (fixture_id) REFERENCES lighting_fixtures(fixture_id)
);

CREATE TABLE lighting_fixture (
   fixture_id INT PRIMARY KEY,
   fixture_name VARCHAR(50),
   wattage INT,
   color_temperature INT
);

CREATE TABLE installation_instruction (
   instruction_id INT PRIMARY KEY,
   fixture_id INT,
   steps VARCHAR(255),
   FOREIGN KEY (fixture_id) REFERENCES lighting_fixture(fixture_id)
);

CREATE TABLE installation_instructions (
  id SERIAL PRIMARY KEY,
  fixture_id INT,
  instructions TEXT,
  warranty_duration INT
);
